import ExpenseItem from './components/ExpenseItem';

function App() {

  const expenses = [
    { id: 'e1', title: "Car Insurance", amount: 434.5, date: new Date(2021, 3, 28) },
    { id: 'e2', title: "Car Insurance", amount: 434.5, date: new Date(2021, 3, 28) },
    { id: 'e3', title: "Car Insurance", amount: 434.5, date: new Date(2021, 3, 28) },
    { id: 'e4', title: "Car Insurance", amount: 434.5, date: new Date(2021, 3, 28) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
